import React from 'react';
import '../App.css';

class Products extends React.Component {
    constructor(props){
        super(props);
        this.onAddToCart = this.onAddToCart.bind(this);
    }

    onAddToCart(){
        alert(this.props.name);
    }
    render() {
        return (
            <div className="col-xs-4 col-sm-4 col-md-4 col-lg-4">
                <div className="card mt-5">
                    <img src="" className="card-img-top" alt="..." />
                    <div className="card-body">
                        <h5 className="card-title">{this.props.name}</h5>
                        <p className="card-text">Products appear by making USA in 2017 </p>
                        {/* <a href="#" className="btn btn-primary" onClick={() => {this.onAddToCart(this.props.name)}}>Buy</a> */}
                        <a href="#" className="btn btn-primary" onClick={this.onAddToCart}>Buy</a>
                    </div>
                </div>
            </div>
        );
    }
}

export default Products;
